package main

import (
   "fmt"
   "log"
   "time"
   "net/http"
)

var good int
var bad int
var connections int
var checklistarray [7000]int

func main() {
	c := make(chan int)
	start := time.Now()
	timelimit := 25
	
	go startrout(c)
	
	for {
		if good + bad == 7000 || timelimit < 0 {
			break
		}
		time.Sleep(1 * time.Second)
		timelimit -= 1
		elapsed := time.Since(start)
		log.Printf("Working time - %s. Result: good - %v, bad - %v. Active connections - %v", elapsed,good,bad,connections)
	}
	
	for i := 0; i < 7000; i++ {
		if checklistarray[i] == 0 {
			log.Printf("Error connection - %v", i)
		}
	}
    elapsed := time.Since(start)
    log.Printf("Working time - %s. Result: good - %v, bad - %v", elapsed,good,bad)
}

func startrout(c chan int){
	for i := 0; i < 7000; i++ {
		connections += 1
		go askhead(c,i)
		for connections >= 200 {
			time.Sleep(1 * time.Millisecond)
		} 
	}
}

func askhead(c chan int,i int){
	resp, err := http.Head(fmt.Sprintf("https://www.google.com/search?q=%v",i))
	if err != nil {
		log.Fatal(err)
	}
	switch resp.StatusCode{
	case 200:
		good += 1
	default:
		bad += 1
	}
	connections -= 1
	checklistarray[i] = 1
}

