public class BirdScript : MonoBehaviour
{
    public AudioSource flap;
    public AudioSource dead;

    public LogicScript logic;
    public Rigidbody2D myRididbody;
    public SpriteRenderer wingflap;


    public float flapStrength;
    public bool BirdIsAlive = true;
    public float flaptimming = 1;
    private float flaptimer = 0;

    // Start is called before the first frame update
    void Start()
    {
        logic = GameObject.FindGameObjectWithTag("Logic").GetComponent<LogicScript>();
        //Those two are from another tutorial to check if it works or not
        //dead = gameObject.AddComponent<AudioSource>();
        //flap = gameObject.AddComponent<AudioSource>();
    }

    // Update is called once per frame
    void Update()
    {
        //Moving the bird
            if (Input.GetKeyDown(KeyCode.Space) == true && BirdIsAlive)
            {
                myRididbody.velocity = Vector2.up * flapStrength ;
                flap.Play(0);
            
            }
        //Changes the wings so it looks like its flapping
        if (Input.GetKeyDown(KeyCode.Space)){
            

                if (flaptimer < flaptimming)
                {
                    flaptimer = flaptimer + Time.deltaTime;
                    wingflap.flipY = true;              
                }
                else
                {
                    flaptimer = 0;
                    wingflap.flipY = false;
                }

            }

        //Detects if you flying too high or low
        if (transform.position.y > 17 || transform.position.y < -16)
        {
            Dying();
            logic.gameOver();
            //Seems like it does die if i fly too high or too low but it dosnt play the death sound 
            //It does play the flap sound if i change it down in dying from dead.Play(); to flap.play() but apparently not if i fly
            //too high or too low
            
        }

    }

    private void OnCollisionEnter2D(Collision2D collision)
    {
        Dying();
    }
    void Dying()
    {
        
        logic.gameOver();
        BirdIsAlive = false;
        Debug.Log("Is it playing death sound?");
        dead.volume = 1.0f;
        dead.Play(0);

    }
}

#include <OneWire.h>
#include <DallasTemperature.h>

namespace pin {
const byte tds_sensor = 34;
const byte one_wire_bus = 17; // Dallas Temperature Sensor
}

namespace device {
float aref = 3.3; // Vref, this is for 3.3v compatible controller boards, for arduino use 5.0v.
}

namespace sensor {
float ec = 0;
unsigned int tds = 0;
float waterTemp = 0;
float ecCalibration = 1;
}

OneWire oneWire(pin::one_wire_bus);
DallasTemperature dallasTemperature(&oneWire);


void setup() {
  Serial.begin(115200); // Dubugging on hardware Serial 0
  dallasTemperature.begin();
}


void loop() {
  readTdsQuick();
   
  delay(1000);

}

void readTdsQuick() {
  dallasTemperature.requestTemperatures();
  sensor::waterTemp = dallasTemperature.getTempCByIndex(0);
  float rawEc = analogRead(pin::tds_sensor) * device::aref / 1024.0; // read the analog value more stable by the median filtering algorithm, and convert to voltage value
  float temperatureCoefficient = 1.0 + 0.02 * (sensor::waterTemp - 25.0); // temperature compensation formula: fFinalResult(25^C) = fFinalResult(current)/(1.0+0.02*(fTP-25.0));
  sensor::ec = (rawEc / temperatureCoefficient) * sensor::ecCalibration; // temperature and calibration compensation
  sensor::tds = (133.42 * pow(sensor::ec, 3) - 255.86 * sensor::ec * sensor::ec + 857.39 * sensor::ec) * 0.5; //convert voltage value to tds value
  Serial.print(F("TDS:")); Serial.println(sensor::tds);
  Serial.print(F("EC:")); Serial.println(sensor::ec, 2);
  Serial.print(F("Temperature:")); Serial.println(sensor::waterTemp,2);
   


}

function chooseTheatrePromotion(day, age) {
    let price = 0;
    let personByAge = '';
    if (age >= 0 && age <= 18) {
        personByAge = 'kid';
    } else if (age > 18 && age <= 64) {
        personByAge = 'adult';
    } else if (age > 64 && age <= 122) {
        personByAge = 'elder';
    }

    switch(personByAge) {
        case 'kid':
            switch(day) {
                case 'Weekday': price = 12; break;
                case 'Weekend': price = 15; break;
                case 'Holiday': price = 5; break;
            }

            break;
        case 'adult':
            switch(day) {
                case 'Weekday': price = 18; break;
                case 'Weekend': price = 20; break;
                case 'Holiday': price = 12; break;
            }

            break;
        case 'elder':
            switch(day) {
                case 'Weekday': price = 12; break;
                case 'Weekend': price = 15; break;
                case 'Holiday': price = 10; break;
            }

            break;
    }

    console.log(price === 0 ? 'Error!' : `${price}$`);
}

